  "contract_number": "00000000000000000000000043146",
  "intro_text": "This Memorandum of Understanding (\"MOU\") is entered into by and between the Indiana Department of Environmental Management (IDEM) and Ivy Tech Community College of Indiana (Ivy Tech), hereinafter referred to as a \"Party\" or \"Parties\". In consideration of the mutual understandings and covenants set forth herein, the Parties agree as follows:",
  "sections": {
    "1. Purpose": "The Indiana Department of Environmental Management (IDEM) and Ivy Tech Community College of Indiana (Ivy Tech) agree to enter into this Memorandum of Understanding (MOU) for the purpose of documenting the understanding between the Parties regarding the use of Ivy Techs' exam administration platform and network of testing centers to be used for exam hosting and delivery of wastewater operator certification examinations. The overall objective is to provide convenient testing services to qualified candidates as determined by IDEM.",
    "2. Provisions": {
      "A. Ivy Tech agrees to": [
        "Host wastewater operator examinations on its secure examination administration platform. Ivy Tech will import existing examination questions provided by IDEM, build question banks and maintain/update examination items as needed or requested by IDEM.",
        "Administer and deliver the examinations at the Ivy Tech facilities listed in Exhibit A, Testing Center Locations, attached and incorporated herein by reference. These facilities are testing-only centers.",
        "Conduct testing in accordance with 327 IAC 5-22-11 as well as instructions provided by IDEM.",
        "Conduct administration of the examinations with processes in place to ensure candidate confidentiality and security of examination content.",
        "Agrees to submit candidate results back to IDEM in a secure fashion agreeable to both parties."
      ],
      "B. IDEM agrees to": {
        "intro_text": "Provide support to Ivy Tech necessary for an effective testing program. Specifically, IDEM agrees to provide the following:"
      }
    }
  }
}
